import React, { Component } from "react";



class BrowseStories extends Component {
    render() {
        return (
            <>
            <h1>This is the BrowseStories page</h1>
            <h3>This will display cards of all completed stories for users to read</h3>
            </>
        )
    }
}

export default BrowseStories;
